import MainNavigation from "../components/MainNavigation";
import PageContent from "../components/PageContent";

function ErrorPage() {
  return (
    <>
      <MainNavigation />
      <main>
        <PageContent title="" />
      </main>
    </>
  );
}

export default ErrorPage;
